apiVersion: v1
kind: Service
metadata:
  name: runner-v542
  annotations:
    cloud.google.com/backend-config: '{"ports": {"80": "runner-v542-backendconfig"}}'
spec:
  selector:
    app.kubernetes.io/name: runner-v542
  ports:
    - protocol: TCP
      port: 80
      targetPort: 8080
  type: NodePort
---
apiVersion: cloud.google.com/v1
kind: BackendConfig
metadata:
  name: runner-v542-backendconfig
spec:
  timeoutSec: 660
  connectionDraining:
    drainingTimeoutSec: 720
---
apiVersion: apps/v1
kind: Deployment
metadata:
  name: runner-v542
  labels:
    app.kubernetes.io/name: runner-v542
spec:
  selector:
    matchLabels:
      app.kubernetes.io/name: runner-v542
  progressDeadlineSeconds: 900
  minReadySeconds: 60
  template:
    metadata:
      labels:
        app.kubernetes.io/name: runner-v542
      annotations:
        commit_sha: "c40d0c1e8a5988515356ce656744bbcfb5e647cd"
        timestamp: "1628798733703"
    spec:
      containers:
        - image: swiftfiddle/runner:5.4.2
          name: runner-v542
          imagePullPolicy: Always
          ports:
            - containerPort: 8080
          readinessProbe:
            httpGet:
              path: /
              port: 8080
          volumeMounts:
            - name: docker-socket
              mountPath: /var/run/docker.sock
            - name: sandbox
              mountPath: /tmp
      volumes:
        - name: docker-socket
          hostPath:
            path: /var/run/docker.sock
        - name: sandbox
          hostPath:
            path: /tmp
---

